import React, { Component } from 'react';
import './Macgyver.css';
 
class Macgyver extends Component {
    render(){
      
      let img = 'https://vejasp.abril.com.br/wp-content/uploads/2016/12/ads_macgyver1.jpg';
   
      return(
          <img src={img} width={250} height={180} />
      );
    }
  }
 
export default Macgyver;
